import React from 'react'
import { SliderData } from './SliderData';

const ImageSlider = () => {
  return (
    // <div>Images</div>
    <>
    {SliderData.map((slide, index) => {
        return (
            <img src ={slide.image} alt='poster' />
        )
    })}
    </>
  )
}

export default ImageSlider
